import React from "react";
import "../css/offer.css";

const Offer = (props) => {
  return (
      <div className="offer">
        <h5 className="title">{props.title}</h5>
        <p className="time">{props.time}</p>
        <p className="price">{props.price}</p>
        <a href="#">Book An Appointment</a>
      </div>
  );
};

export default Offer;
